@D_Auguland My favorite D'Aug-ism:  Passing a plate of cookies, with only one left:
D'Aug:"you want this?" 
Eileen: "nope."
D'Aug: "you sure? Because I don't wanna hear you griping when I eat it!"
Eileen: &lt;falls on floor, laughing&gt;

@eclasper Why did the bluebird refuse to use Facebook? 
Because he preferred to tweet?
No, because Facebook has terrible data privacy problems.
